import React, { Component } from 'react';
import { Button, Box, AppBar, Toolbar, IconButton, Container, Typography } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';
import {makeStyles} from '@material-ui/core/styles';

const useStyles = makeStyles((theme: any) =>({
    root: {
        flexGrow: 1
    },
    menuButton: {
        marginRight:theme.spacing(1)
    },
    title: {
        flexGrow: 1
    }
}))

type AppbarProps = {
    classes: any
}

class Appbar extends Component<AppbarProps>
{

    render() {
        const classes = this.props.classes;
        return (
            <AppBar color="primary" position="fixed">
                <Toolbar>
                    <Container fixed style={{flexDirection:"column"}}>
                        <Box display="inline">
                            <IconButton edge="start" color="inherit" aria-label="menu" className={classes.menuButton}>
                                <MenuIcon />
                            </IconButton>
                        </Box>
                        <Typography variant="h6" className={classes.title} >Expense Tracker</Typography>
                        <Box mr={3} display="inline">
                            <Button color="inherit" variant="outlined">
                                Sign in
                            </Button>
                        </Box>
                        <Box display="inline">
                            <Button color="secondary" variant="contained">
                                Sign up
                            </Button>
                        </Box>
                    </Container>
                </Toolbar>
            </AppBar>
        )
    }
}

export default () => {
    const classes = useStyles();
    return <Appbar classes={classes} />
};
